			levelIcons = [selectScreen.select1,selectScreen.select2,selectScreen.select3,selectScreen.select4,selectScreen.select5,selectScreen.select6,selectScreen.select7,selectScreen.select8,selectScreen.select9,selectScreen.select10,selectScreen.select11,selectScreen.select12];
			
